import React, { lazy, Suspense } from 'react';
import {Box} from '@chakra-ui/react';

const Loading = () => {
  return (
    <Box minHeight='100vh'>
        <p>Loading....</p>
    </Box>
  )
}

const loadable = (importFunc, fallback = <Loading/> ) => {
  const LazyComponent = lazy(importFunc);

  return props => (
    <Suspense fallback={fallback}>
      <LazyComponent {...props} />
    </Suspense>
  );
};

export default loadable;
